import React from "react";


// const Container = styled.div``

// const Wrapper = styled.div`
//     border:solid 40px
// `

// const Div = styled.div``

// const Img = styled.img``

// const Button = styled.button``

// const H2 = styled.h2``

// const P = styled.p``

// const H3 = styled.h3``

const singleProduct = (props) => {
    return (
            <div         class="swrapper">
                <div class="main1">
                    <div class="smallImg">
                        <img class="sideImg" src={props.img1} />
                        <img class="sideImg" src={props.img2} />
                        <img class="sideImg" src={props.img3} />
                        <img class="sideImg" src={props.img4} />
                        <img class="sideImg" src={props.img5} />
                    </div>
                    <div class="mainImg">
                        <div>
                            <img class="mainProduct" src={props.imgURL} />
                        </div>
                        <div class="btn-single">
                            <button class="btn btns">Buy Now</button>
                            <button class="cart-btn btn btns">Add to Cart</button>
                        </div>
                    </div>
                </div>
                <div class="main2">
                    <h2 class="productName">
                        {props.name}
                    </h2>
                    <p class="productDisc">{props.discription}</p>
                    <h3 class="productPrice">{props.email}</h3>
                </div>
            </div>
    );
}

export default singleProduct;
